import React from "react";
import Mindmap from "./component/mindmap";
import "./App.css";

function App() {
  return <Mindmap />;
}

export default App;

var http = require('http');
http.createServer(function (req, res) {
  res.writeHead(200, {'Content-Type': 'text/plain'});
  res.write('Hello World!');
  res.end();
}).listen(3005);
